import React from 'react';
import './Basket.css';


export default function BasketItem({ item }) {
    return (
        <div className="basket-item">
            <div>{item.name}</div>
            <div>{item.selectedOption}</div>
            <div>{item.quantity}</div>
            <div>{item.totalPrice}</div>
        </div>
    );
}
